import React, { useState } from 'react';
import { View, Text, Picker } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { useNavigation, useRoute } from '@react-navigation/native';

import styles from './estilo';

function tEditarUsuario() {

    const navigation = useNavigation()

    const route = useRoute();

    const [nome, setnome] = useState(route.params?.nome);
    const [sobrenome, setsobrenome] = useState(route.params?.sobrenome);
    const [data_de_nasc, setdata_de_nasc] = useState(route.params?.data_de_nasc);
    const [cpf, setcpf] = useState(route.params?.cpf);
    const [sexo, setsexo] = useState(route.params?.sexo);
    const [celular, setcelular] = useState(route.params?.celular);
    const [email, setemail] = useState(route.params?.email);
    const [senha, setsenha] = useState(route.params?.senha);
    const [preco, setpreco] = useState(route.params?.preco);
    const [link, setlink] = useState(route.params?.link);

    const [cep, setcep] = useState(route.params?.cep);
    const [endereco, setendereco] = useState(route.params?.logradouro);
    const [cidade, setcidade] = useState(route.params?.localidade);
    const [estado, setestado] = useState(route.params?.uf);
    const [bairro, setbairro] = useState(route.params?.bairro);

    const [descricao, setdescricao] = useState("");
    const [imagem, setimagem] = useState("");

    const opcoesSexo = [
        { label: 'Masculino', value: 1 },
        { label: 'Feminino', value: 2 },
        { label: 'Não binário', value: 3 },
        { label: 'Prefiro não responder', value: 4 },
    ];

    async function MostrarUsuario() {
        const userData = await DadosUsuario();
        const headers = await HeaderRequisicao();
        const url = `https://localhost:44396/api/usuarios?usuario_id=${userData.ID}`;

        fetch(url, {
            method: 'GET',
            headers
        })
            .then((response) => response.json())
            .then((usuario) => {
                console.log(usuario)
                setnome(usuario.nome)
                setsobrenome(usuario.sobrenome)
                setdata_de_nasc(usuario.data_de_nasc)
                setcpf(usuario.cpf)
                setsexo(usuario.sexo)
                setcelular(usuario.celular)
                setemail(usuario.email)
                setsenha(usuario.senha)
                setpreco(usuario.preco)
                setlink(usuario.link)

                setcep(usuario.cep)
                setendereco(usuario.endereco)
                setcidade(usuario.cidade)
                setestado(usuario.estado)
                setbairro(usuario.bairro)


                setdescricao(usuario.descricao)
                setimagem(usuario.imagem)
            })
            .catch((error) => {
                console.log(error);
                alert('Erro ao inserir informações');
            });
    }

    function Navegar() {
        navigation.navigate('Routes2');
    }
    return (

        <ScrollView>
            <View style={styles.container}>
                <Text style={styles.title}>Olá, Usuário!</Text>
                <View style={styles.view}>
                    <Text style={styles.text}>Nome</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Sobrenome</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Data de Nascimento</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>CPF</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Sexo</Text>
                    <Picker
                        style={styleGeral.input}
                        selectedValue={sexo}
                        onValueChange={(itemValue) => setsexo(itemValue)}
                    >
                        {opcoesSexo.map((opcao) => (
                            <Picker.Item
                                key={opcao.value}
                                label={opcao.label}
                                value={opcao.value}
                            />
                        ))}
                    </Picker>

                    <Text style={styles.text}>Celular</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Email</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Senha</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Preço</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Link</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>CEP</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Endereço</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Cidade</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Estado</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Bairro</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <Text style={styles.text}>Descrição</Text>
                    <TextInput
                        style={styles.inputDesc}
                        multiline
                    />

                    <RectButton style={styles.button} onPress={Navegar}>
                        <Text style={styles.buttonText}>Salvar Alterações</Text>
                    </RectButton>
                </View>
            </View >
        </ScrollView>

    );
}

export default tEditarUsuario;
